import React from 'react'
import styled from 'styled-components'

const Card = () => {

    const Card = styled.div`
    width: 22vw;
    border: 6px solid white;
    display: flex;
    flex-direction: column;
    overflow-Y: hidden; 
  `

    return (
        <Card>
        <img alt="img" width="300px" src="https://news.artnet.com/app/news-upload/2019/01/Cat-Photog-Feat-256x256.jpg"></img>
        </Card> 
    )
}

export default Card
